INSERT INTO alkalmazottak VALUES
(1, 'Davolio', 'Nancy', 'Üzletkötő', 'Ms.', '1948-12-08 00:00:00', '1992-05-01 00:00:00', '507 - 20th Ave. E.\r\nApt. 2A', 'Seattle', 'WA', '98122', 'USA', '(206) 555-9857', '5467', x'', '1970-ben kapta meg főiskolai diplomáját a Colorado Állami Egyetem filozófia szakán. Elvégezte a "The Art of the Cold Call" tanfolyamot. Nancy tagja a Toastmasters Internationalnek.', 2, 2954.55),
(2, 'Fuller', 'Andrew', 'Alelnök, Értékesítés', 'Dr.', '1952-02-19 00:00:00', '1992-08-14 00:00:00', '908 W. Capital Way', 'Tacoma', 'WA', '98401', 'USA', '(206) 555-9482', '3457', x'', 'Andrew 1964-ben végezte el a kereskedelmi szakközépiskolát, és a diplomáját a Dallasi egyetemen szerezte nemzetközi piackutatásból 1971-ben. Folyékonyan beszél franciául, olaszul és olvas németül. Üzletkötőként kezdett dolgozni a cégnél, majd 1992 januárjában előléptették értékesítési igazgatóvá, és értékesítési alelnökké 1993 márciusában. Andrew tagja a Sales Management Roundtable társaságnak, a Seattle Chamber of Commerce-nek és a Pacific Rim Importers Associationnek.', NULL, 2254.49),
(3, 'Leverling', 'Janet', 'Üzletkötő', 'Ms.', '1963-08-30 00:00:00', '1992-04-01 00:00:00', '722 Moss Bay Blvd.', 'Kirkland', 'WA', '98033', 'USA', '(206) 555-3412', '3355', x'', 'Janet Bostonban szerzett főiskolai diplomát kémia szakon (1984). Elvégzett egy élelmiszer-kereskedelmi tanfolyamot. 1991-ben kezdett dolgozni mint bonyolító, 1992 februárjában előléptették üzletkötővé.', 2, 3119.15),
(4, 'Peacock', 'Margaret', 'Üzletkötő', 'Mrs.', '1937-09-19 00:00:00', '1993-05-03 00:00:00', '4110 Old Redmond Rd.', 'Redmond', 'WA', '98052', 'USA', '(206) 555-8122', '5176', x'', 'Margaret a Concordia College angol irodalom szakát végezte el (1958), majd diplomát szerzett a Vendéglátóipari Egyetemen (1966). 1992 júliusától novemberig a londoni kirendeltségen dolgozott.', 2, 1861.08),
(5, 'Buchanan', 'Steven', 'Kereskedelmi igazgató', 'Mr.', '1955-03-04 00:00:00', '1993-10-17 00:00:00', '14 Garrett Hill', 'London', NULL, 'SW1 8JR', 'Egyesült Királyság', '(71) 555-4848', '3453', x'', 'Steven Buchanan a St. Andrews Egyetemet végezte el Skóciában 1976-ban. 1992-ben üzletkötőként lépett be a céghez, majd egy továbbképző program keretében 6 hónapot töltött Seattle-ben. 1993 márciusában előléptették kereskedelmi igazgatóvá. Buchanan elvégezte a Successful Telemarketing és az International Sales Management tanfolyamot. Folyékonyan beszél franciául.', 2, 1744.21),
(6, 'Suyama', 'Michael', 'Üzletkötő', 'Mr.', '1963-07-02 00:00:00', '1993-10-17 00:00:00', 'Coventry House\r\nMiner Rd.', 'London', NULL, 'EC2 7JR', 'Egyesült Királyság', '(71) 555-7773', '428', x'', 'Michael a Sussex-i egyetem közgazdasági szakán (1983), majd Los Angelesben a California Egyetemen (1986) diplomázott. Utána elvégzett egy a nemzetközi kereskedelemről szóló tanfolyamot. Tökéletesen beszél japánul, ír és olvas franciául, portugálul és spanyolul.', 5, 2004.07),
(7, 'King', 'Robert', 'Üzletkötő', 'Mr.', '1960-05-29 00:00:00', '1994-01-02 00:00:00', 'Edgeham Hollow\r\nWinchester Way', 'London', NULL, 'RG1 9SP', 'Egyesült Királyság', '(71) 555-5598', '465', x'', 'Robert King a Békehadtestnél szolgált, és sokat utazgatott, mielőtt elvégezte volna a Michigani Egyetem angol szakát 1992-ben, ezután került a céghez. Miután befejezte a "Selling in Europe" tanfolyamot, áthelyezték a Londoni kirendeltséghez 1993 márciusában.', 5, 1991.55),
(8, 'Callahan', 'Laura', 'Belkereskedelmi szervező', 'Ms.', '1958-01-09 00:00:00', '1994-03-05 00:00:00', '4726 - 11th Ave. N.E.', 'Seattle', 'WA', '98105', 'USA', '(206) 555-1189', '2344', x'', 'Laura a Washingtoni Egyetemen diplomázott pszichológiából. Elvégzett egy francia üzleti nyelv tanfolyamot. Franciául olvas és ír.', 2, 2100.50),
(9, 'Dodsworth', 'Anne', 'Üzletkötő', 'Ms.', '1966-01-27 00:00:00', '1994-11-15 00:00:00', '7 Houndstooth Rd.', 'London', NULL, 'WG2 7LT', 'Egyesült Királyság', '(71) 555-4444', '452', x'', 'Anne a St. Lawrence College angol tagozatán végzett. Folyékonyan beszél franciául és németül.', 5, 2333.33);
